static defaultProps = {
    numBoxes:18
}

    render(){

        const boxes  = Array.from({length: this.props.numBoxes}).map(() =>(<Box/>));
        return(
            <div className = "BoxContainer">
                {boxes}
            </div>
        );
    }
}

